import React from 'react'
import Header from './Header'
import { useState, useEffect } from 'react'

function Users() {
    const [error, setError] = useState(null);
    const [isLoaded, setIsLoaded] = useState(false);
    const [items, setItems] = useState([]);

    const [name, setName] = useState('');
    const [username, setUsername] = useState('');
    const [email, setEmail] = useState('');
    const [phone, setPhone] = useState('');
    const [website, setWebsite] = useState('');

    // address
    const [street, setStreet] = useState('');
    const [suite, setSuite] = useState('');
    const [city, setCity] = useState('');
    const [zipcode, setZipcode] = useState('');
    //address//geo
    const [lat, setLat] = useState('');
    const [lng, setLng] = useState('');

    //company
    const [companyName, setCompanyName] = useState('');
    const [catchPhrase, setCatchPhrase] = useState('');
    const [bs, setBs] = useState('');

    useEffect(() => {
        fetch("http://localhost:3005/users")
            .then(res => res.json())
            .then(
                (result) => {
                    setIsLoaded(true);
                    setItems(result);
                },
                (error) => {
                    setIsLoaded(true);
                    setError(error);
                }
            )
    }, [])
    const submitHandler = (e) => {
        // console.log("name", name)
        // console.log("username", username)
        // console.log("email", email)
        // console.log("address", address)
        // console.log("phone", phone)
        // console.log("company", company)
        // console.log("website", website)
        e.preventDefault()
    }

    if (error) {
        return <div>Error: {error.message}</div>;
    } else if (!isLoaded) {
        return <div>Loading...</div>;
    } else {
        return (
            <>
                <Header />
                <div style={{ textAlign: 'center' }}>
                    <form onSubmit={submitHandler}>

                        <button type="submit">Submit</button>
                    </form>
                </div>
                <ul>
                    {items.map(item => (
                        <li key={item.id}>{item.id}
                            <ul>
                                <li>Name: {item.name}</li>
                                <li>Email: {item.email}</li>
                                <li>Username: {item.username}</li>
                                Address:
                                <ul>
                                    <li>street : {item.address.street}</li>
                                    <li>suite : {item.address.suite}</li>
                                    <li>city : {item.address.city}</li>
                                    <li>zipcode : {item.address.zipcode}</li>
                                    Geo:
                                    <ul>
                                        <li>lat : {item.address.geo.lat}</li>
                                        <li>lng : {item.address.geo.lng}</li>
                                    </ul>
                                </ul>
                                <li>phone: {item.phone}</li>
                                <li>website: {item.website}</li>
                                company:
                                <ul>
                                    <li>name : {item.company.name}</li>
                                    <li>catchPhrase : {item.company.catchPhrase}</li>
                                    <li>bs : {item.company.bs}</li>
                                </ul>
                            </ul>
                        </li>
                    ))}
                </ul>
            </>
        );
    }
}
export default Users
